import React from "react";
import { useParams } from "react-router-dom";
import '../Main.css'
const Product = ({ allCars }) => {
  const { id } = useParams();
  const product = allCars.find((car) => car.id.toString() === id);
  console.log(product.title) 
  if (!product) {
    return <div>Product not found</div>;
  }

  return (
    <div>
    <main>
        <div class="card">
            <div class="card__img">
                    <img src={product.img} alt=""/>                    
            </div>
            <div class="card__content">
                <p class="card__tag">perfume</p>
                <h1 class="card__title">Gabrielle essence eau de parfum</h1>
                <p class="card__desc">A floral, solar and voluptuous 
                interpretation composed by Olivier Polge, Perfumer-Creator for the House of CHANEL.</p>
                <div class="card__price">
                    <h1>$149.99</h1>
                    <s>$169.99</s>
                </div>

            </div>
        </div>
    </main>
    </div>
  );
};

export default Product;
